package model.entity;public class SandWich {    private String Lettuce;    private String Tomato;    private String Mustard;    private String Sprouts;    public SandWich() {    }    public SandWich(String lettuce, String tomato, String mustard, String sprouts) {        Lettuce = lettuce;        Tomato = tomato;        Mustard = mustard;        Sprouts = sprouts;    }    public String getLettuce() {        return Lettuce;    }    public void setLettuce(String lettuce) {        Lettuce = lettuce;    }    public String getTomato() {        return Tomato;    }    public void setTomato(String tomato) {        Tomato = tomato;    }    public String getMustard() {        return Mustard;    }    public void setMustard(String mustard) {        Mustard = mustard;    }    public String getSprouts() {        return Sprouts;    }    public void setSprouts(String sprouts) {        Sprouts = sprouts;    }    @Override    public String toString() {        return "SandWich{" +                "Lettuce='" + Lettuce + '\'' +                ", Tomato='" + Tomato + '\'' +                ", Mustard='" + Mustard + '\'' +                ", Sprouts='" + Sprouts + '\'' +                '}';    }}